ERROR - 2017-04-18 09:58:49 --> Query error: Column 'service_category' cannot be null - Invalid query: INSERT INTO `tbl_mst_blog_posts` (`post_title`, `blog_category`, `blog_image`, `post_content`, `posted_by`, `posted_on`, `status`, `service_category`, `slug`) VALUES ('Let The Right Bugs Into Your Garden This Spring', 'Social Media', '149253472722060.jpg', '<p>Sometimes it&rsquo;s hard to think of any insect messing around in my garden as a good thing. Why can&rsquo;t they all just leave my poor plants alone, and find another yard to live in? However, even if they could just all leave your garden in complete peace, you wouldn&rsquo;t want them to, as some insects are actually vital to the health of some plants and a necessary player in helping the plant to mature. On top of that, completely ridding your garden or yard of insects is impossible, and because of that you at least want to have some of those insects in your garden that gobble up the insect pests that do real harm to your plants. The key is to&nbsp;<a href=\"http://www.care2.com/greenliving/9-beneficial-bugs-insects-to-welcome-in-the-garden.html\">welcome only the right bugs into your garden</a>.</p>\r\n\r\n<p>Luckily, most of the insects you see in your garden are beneficial, with only a handful of them posing an actual threat to your plants. You might want to consider keeping some of those beneficial insects around. If you happen to see a malicious insect invader and have some of those handy predatory beneficial bugs hanging around, in a few days time that pest will have become lunch or dinner for one of them, and no longer your problem.</p>\r\n\r\n<p>One beneficial insect you want to have living in your garden this spring is the ladybug. First of all, who doesn&rsquo;t already love ladybugs? They&rsquo;re cute, brightly colored, and were likely one of the few bugs you didn&rsquo;t mind picking up and making friends with as a child (at least if you were a cautious and somewhat nature-suspicious little tyke as I was). Ladybugs are also great predators to have in your garden, as they have absolutely voracious appetites, eating the worst garden pests such as aphids, thrips, white flies, mites, and mealybugs just to name a few.</p>\r\n\r\n<p>Another beneficial insect you want to make sure you have in your garden is any type of pollinator such as bees. Any plant that grows flowers needs the help of pollinators for fertilization. This is what helps those plants grow and mature, so they can then produce the fruit or vegetable crop they are planted to provide. So, if you want any of your crops or other flowering plants to thrive, you&rsquo;d better make sure you&rsquo;ve got some pollinators in your garden.</p>\r\n\r\n<p>What other beneficial insects are good to have in your garden?</p>\r\n', '1', '2017-04-18 09:58:49', '1', NULL, 'let-the-right-bugs-into-your-garden-this-spring')
